import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron'
import video from './videos/dna5.gif'
import { Tabs, Tab } from 'react-bootstrap';
import { Fraction, toTex } from 'algebra.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css';

function App() {
  const fract = new Fraction("G+C", "Total number of nucleotides")
  const answer = "GC %"
  return (
    <div className="App">
      <header className="App-header">
        <Jumbotron>
          <h1>Bioinformatics:
            <p3> Learning Tools </p3>
            <img src={video} alt="gif"/>
          </h1>
          <Tabs defaultActiveKey="Description">
            <Tab eventKey="Description" title="Description">
              <p classname="App-Description"> 
                <br/> This website aims to aid the understanding of fundamental concepts in Bioinformatics.
                      Some topics covered are calculation of CG content in a given sequence and transcription.
              </p>
            </Tab>
            <Tab eventKey="GC Content" title="GC Content"></Tab>
            <p>
              <br/> The GC content in a genome is expressed as the propotion of guanine and cytosine bases in the DNA sequence.
                    {fract}
            </p>
            <Tab eventKey="Transcription" title="Transcription"></Tab>
          </Tabs>
        </Jumbotron>
      </header>
    </div>


  );
}

export default App;
